    return (
        <div>
            <Form>
                <FormGroup>
                    <Label for="exampleEmail">Plain Text (Static)</Label>
                    <Input plaintext value="Some plain text/ static value" />
                </FormGroup>
            </Form>
            <Button color={'success'}>add</Button>
            <Button color={'info'}>delete</Button>
        </div>
    );
};

